# 每次桌子的固定的某个座位开始追加，形成列表
seat = ['A1','A2','B1','B2','C1','C2']

print(sorted(seat,key=lambda x:x[0]))

from itertools import permutations
seats = list(permutations(seat,6))
print(seats[0])
ans = []
for couple in seats:
    #for c in couple:
        #print(c)
        #if c[0][0] == c[1][0] and c[2][0] == c[3][] and c[4][0] == c[5][0]
    if all(couple[i][0] == couple[i+1][0] for i in range(0,len(couple),2)):
            #print(c)
        ans.append(couple)
#print(seats,len(seats))
print(len(ans),ans)

